import "./App.css";

function App() {
  function jsgrid() {
    let data = [];
    for (let i = 0; i < 10; i++) {
      data.push([]);
      for (let j = 0; j < 10; j++) {
        data[i].push(0);
      }
    }
    console.table(data)
  }
  return <div className="App">
    jsgrid()
  </div>;
}

export default App;
